std::string markdownToHtml(const std::string& markdown) {
    std::string html;

    size_t pos = 0;
    while (pos < markdown.size()) {
        size_t start = markdown.find_first_of("*_", pos);
        if (start == std::string::npos) {
            html += markdown.substr(pos);
            break;
        } else {
            html += markdown.substr(pos, start - pos);
            pos = start;
            size_t end = markdown.find_first_of("*_", pos + 1);
            if (end == std::string::npos) {
                html += markdown.substr(pos);
                break;
            } else {
                html += "<b>" + markdown.substr(start + 1, end - start - 1) + "</b>";
                pos = end + 1;
            }
        }
    }

    return html;
}
