#include <iostream>
#include <fstream>
#include <string>

int main() {
    std::string filename;
    std::string word;
    int count = 0;

    std::cout << "Enter the name of the text file: ";
    std::cin >> filename;

    std::cout << "Enter the word to count: ";
    std::cin >> word;

    std::ifstream file(filename);

    if (!file.is_open()) {
        std::cout << "Error opening file." << std::endl;
        return 1;
    }

